import Vue from 'vue'
import App from './App.vue'
import router from './router'
import './registerServiceWorker'
import VueAwesomeSwiper from 'vue-awesome-swiper'
require('../public/src/js/promise.js')
require('../public/src/js/fetch.js')
//require('../public/src/js/cashdyn.js')
require('../public/src/js/idb.js')
require('../public/src/js/material.min.js')
require('../public/src/js/utility.js')
// require styles
import 'swiper/dist/css/swiper.css'

Vue.use(VueAwesomeSwiper, /* { default global options } */)
Vue.config.productionTip = false
var promise = new Promise(function (resolve, reject) {
    setTimeout(function () {
        resolve('This is executed once the timer is done!');
        reject({
            code: 500,
            message: 'An error occurred!'
        });
        //console.log('This is executed once the timer is done!');
    }, 3000);
});
if(!window.Promise){
    window.Promise= promise;
}




function updateUI(data) {
        window.resp1 = data[0];
    for (var i = 0; i < 415; i++) {

writeData('trees', resp1[i]); 
        console.log(resp1[i]);

    }
}
fetch('http://192.168.0.8/trash/trees')
    .then(function (response) {
        console.log(response);
       return response.json();
    })
    .then(function (data) {

         window.dataArrayTree = [];
        for (var key in data) {
            dataArrayTree.push(data[key]);

        }
          updateUI(dataArrayTree);
        console.log('From web FETCH 0 >', dataArrayTree);
    })
    .catch(function (err) {
        console.log(err);
    });



new Vue({
  router,
  render: h => h(App)
}).$mount('#app')


promise.then(function (text) {
    return text;
}).then(function (newText) {
    console.log(newText);
}).catch(function (err) {
    console.log(err.code, err.message);
});
console.log('This is executed right after setTimeout()');
